function createXMLhttpRequest(){var e;if(window.XMLHttpRequest)e=new XMLHttpRequest;else try{e=new ActiveXObject("Microsoft.XMLHTTP")}catch(e){alert("ActiveX is turned off. Please Enable or upgrade your browser. System Message :"+e.message,"Warning")}return e}function createXMLdoc(e){var t;if(e.responseXML)return e.responseXML;if(window.DOMParser)return t=e.responseText,parser=new DOMParser,parser.parseFromString(t,"text/xml");if(window.ActiveXObject)try{t=e.responseText;var r=new ActiveXObject("Microsoft.XMLDOM");return r.async=!1,r.loadXML(t),r}catch(e){alert("ActiveX is turned off. Please Enable or upgrade your browser. System Message :"+e.message,"Warning")}else alert("Cannot parse XML. Your browser may be too old.","Warning")}function createXMLparser(e){if(window.DOMParser)parser=new DOMParser,xmlDoc=parser.parseFromString(e,"text/xml");else if(window.ActiveXObject)try{xmlDoc=new ActiveXObject("Microsoft.XMLDOM"),xmlDoc.async=!1,xmlDoc.loadXML(e)}catch(e){alert("ActiveX is turned off. Please Enable or upgrade your browser. System Message :"+e.message,"Warning")}else alert("Cannot lookup identify information. Your browser may be too old.","Warning");return xmlDoc}function createMultiXMLhttpRequest(){if(window.XMLHttpRequest)XMLHttpRequestObjects.push(new XMLHttpRequest);else if(window.ActiveXObject)try{XMLHttpRequestObjects.push(new ActiveXObject("Microsoft.XMLHTTP"))}catch(e){alert("ActiveX is turned off. Please Enable or upgrade your browser. System Message :"+e.message)}index=XMLHttpRequestObjects.length-1}